import React from "react";
import { TouchableOpacity } from "react-native";


export default function inputButton(props){

    return(
        <TouchableOpacity 
        onPress={()=>props.handleOnPress(props.value)}
        >
            {props.value}
        </TouchableOpacity>
    )
}
